import React, { Component } from 'react';
import '../App.css';
import Warmup1 from './Warmup1';
import Warmup2 from './Warmup2';
import Warmup3 from './Warmup3';

class WarmupsCombined extends Component {
    render() {
        return (
            <div>
            <Warmup1 />
            <Warmup2 />
            <Warmup3 />
            </div>
        )
    }
}

export default WarmupsCombined;
